import React, { Component } from 'react';

class SearchBar extends Component {
    render(props) { 
        return ( 
            <div>
                <input 
                    value={this.state.text}
                    onKeyDown={this.handleTextChange}
                />
            </div>
         );
    }
}

export default SearchBar;
